    public function getSourceContext()
    {
        return new Source("<!DOCTYPE html>
<html lang=\"fr\">
    <head>
        <meta charset=\"UTF-8\">
        <title>{% block title %}NOM SITE{% endblock %}</title>

        {% block stylesheets %}
            <link href=\"{{ asset('CSS/style.css') }}\" rel=\"stylesheet\" >
        {% endblock %}

        {% block javascripts %}

        {% endblock %}
    </head>

    <body>
        <header class=\"header\">
            {% block header %}
                <nav class=\"nav\">
                    <label class=\"label\">NOM</label>
                    <ul>
                        {% if not app.user %}
                            {{ render(controller('App\\\\Controller\\\\SiteController::routeAnonyme')) }}
                        {% else %}
                            {{ render(controller('App\\\\Controller\\\\SiteController::routeAdmin')) }}
                            {{ render(controller('App\\\\Controller\\\\SiteController::routeUtilisateur')) }}

                            <li>
                                <a href=\"{{ path('security_logout') }}\">Déconnexion</a>
                            </li>
                        {% endif %}

                    </ul>
                </nav>
            {% endblock %}
        </header>
        <div class=\"vue\">
            {% block body %}
                <h1>
                    {% block titre_principal %}

                    {% endblock %}
                </h1>
                {% block vue %}

                {% endblock %}
            {% endblock %}
        </div>
        <footer class=\"footer\">
            {% block footer %}

            {% endblock %}

        </footer>
    </body>
</html>
", "base.html.twig", "C:\\wamp64\\www\\projet\\templates\\base.html.twig");
